import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button, Avatar } from '@mui/material';
import { Search as SearchIcon, ShoppingCart as ShoppingCartIcon } from '@mui/icons-material';

const Navbar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          FoodPacker
        </Typography>
        <IconButton color="inherit" aria-label="search">
          <SearchIcon />
        </IconButton>
        <IconButton color="inherit" aria-label="shopping cart">
          <ShoppingCartIcon />
        </IconButton>
        <Avatar alt="Customer" src="/path/to/customer/avatar.jpg" />
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
